window.bookSummaryJSON = "<p>***Stuck-together, stranger-to-lovers, Steamy Hockey Romance***<br> Seven and Brynn<br> <br> As the last line of defense for the Hawkeyes hockey team, I've mastered the art of keeping my guard up, both on and off the ice. But when Brynn Fischer, a determined romance author with a case of writer's block, shows up at my beach house in Mexico as a hurricane is headed straight for us, I'm forced to let her stay and confront emotions that I have no defense against.</p> <p>Now, we're stuck together while the storm rages outside and I'm faced with my own battle insideâ€”keeping to my \"no relationship\" rule that's served me well over the last eighteen years.</p> <p>But when Brynn starts showing me all the ways that she's nothing like anyone I've ever met, the armor I've built around my heart isn't strong enough to keep her out.</p> <p>Just when I think I'm ready to let her in, I discover she's planning to get back together with her ex when she returns to Seattle. Now, I have to make the toughest decision of my life.</p> <p>Do I let her go for good? Or do I make the play of a lifetime and fight for the love I never saw coming?</p>"; 
